import * as React from "react";
import { AppData } from "./appdata";

const SkillTable = props => {
  let { state, dispatch } = React.useContext(AppData);

  const tabdata = props.tabdata;
  return (
    <table>
      <thead>
        <tr>
          <th>Skill</th>
          <th>Years</th>
          <th>Proficiency n/10</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          {tabdata.map((data, index) => {
            return (
              <React.Fragment key={index}>
                <td className="can-edit">{data.name}</td>
                <td className="can-edit">{data.years}</td>
                <td className="can-edit">{data.prof}</td>
              </React.Fragment>
            );
          })}
        </tr>
      </tbody>
      <tfoot></tfoot>
    </table>
  );
};
