        <tbody>
            <tr>
                <td class="can-edit">{{name}}</td>
                <td class="can-edit">{{years}}</td>
                <td class="can-edit">{{prof}}</td>
            </tr>        
        </tbody>
		<tfoot></tfoot>
	</table>    
`;
*/
export default SkillTable;
